import React from 'react';
// import '../App.css';
import {Button} from '../Button';
import './AboutMe.css';
import portrait from './portrait.jpg';

function AboutMe() {
    return (
        <>
        <h1>SUZANNE AUGUST</h1>
        <div className="left">
            <img src={portrait} className="image" />
        </div>
        <div className="right">
            <p> A LOT OF STUFF ABOUT ME </p>
        </div>
        </>
    )
}

export default AboutMe
